import React, { useEffect, useState } from "react";
import SpanText from "../../components/spanText/SpanText";
import spansInfos from "./spans.json"
import "./Proposito.css"
const Proposito = (props)=>{
    const [spansTexts,setSpansTexts] = useState([])

    useEffect(()=>{
        const spans = spansInfos.map(infos=>{
            return <SpanText img={infos.img} title={infos.title} bodyText={infos.bodyText}/>
        })
    },[])

    return (
        <div className="ctn-proposito">
            <div className="title">
                PROPÓSITO
            </div>
            <div className="proposito-content">
                <SpanText img={"clock.svg"} title={"PREVENIR ATRASOS"} bodyText={"O atraso na entrega é o principal incômodo das pessoas em relação a serviços de manutenção, construção civil, marcenaria, etc. A Nexus acredita  que o atraso na entrega está associado à falta ou o mau planejamento de obras e outras tarefas."}/>
            </div>
        </div>
    )
}

export default Proposito
